import React, { useState } from "react";
import { Button, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from "@mui/material";
import { makeStyles } from "@mui/styles";
import NewProfileForm from "./NewProfileForm";
import { collection, addDoc } from "firebase/firestore";
import { db } from "../firebase"; // Assuming you have a db instance exported from firebase.js

const useStyles = makeStyles((theme) => ({
    table: {
      minWidth: 650,
    },
    tableHeaderCell: {
      fontWeight: "bold",
      backgroundColor: theme.palette.primary.main,
      color: theme.palette.primary.contrastText,
    },
    addButton: {
      margin: theme.spacing(2),
    },
  }));

function ProfilePage() {
  const classes = useStyles();
  const [openForm, setOpenForm] = useState(false);

  const handleOpenForm = () => {
    setOpenForm(true);
  };

  const handleCloseForm = () => {
    setOpenForm(false);
  };

  const addProfile = async (newProfile) => {
    try {
      // Add the new profile data to Firestore
      const docRef = await addDoc(collection(db, "profiles"), newProfile);
      console.log("Profile added with ID: ", docRef.id);
    } catch (e) {
      console.error("Error adding profile: ", e);
    }
  };

  return (
    <div>
      <h1>Profiles</h1>
      <Button variant="contained" color="primary" onClick={handleOpenForm}>
        Add New Profile
      </Button>
      <TableContainer component={Paper}>
        <Table className={classes.table}>
          <TableHead>
            <TableRow>
              <TableCell className={classes.tableHeaderCell}>Name</TableCell>
              <TableCell className={classes.tableHeaderCell}>Position</TableCell>
              <TableCell className={classes.tableHeaderCell}>Past Projects</TableCell>
              <TableCell className={classes.tableHeaderCell}>Years of Expertise</TableCell>
              <TableCell className={classes.tableHeaderCell}>Technical Skills</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {profilesData.map((profile) => (
              <TableRow key={profile.id}>
                <TableCell>{profile.name}</TableCell>
                <TableCell>{profile.position}</TableCell>
                <TableCell>{Array.isArray(profile.pastProjects) ? profile.pastProjects.join(", ") : ""}</TableCell> {/* Check if pastProjects is an array */}
                <TableCell>{profile.expertiseYears}</TableCell>
                <TableCell>{profile.technicalSkills.join(", ")}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
      <NewProfileForm open={openForm} handleClose={handleCloseForm} addProfile={addProfile} />
    </div>
  );
}

export default ProfilePage;
